import formidable from "formidable"
import fs from "fs"

const uploadImg = process.cwd()+"/storages/"

const uploadImages = async(req,res,next)=>{
    const options = {
        multiples :false,
        keepExtentions:true,
        uploadImg:uploadImg,
        maxFileSize:50*1024*1024,
    }

    const form = formidable(options)
    let files = {};
    let fields = []

    form
        .on('field',(fieldName, value)=>{
            fields.push({fieldName,value})
        })
        .on('file',(fieldName,value)=>{
            files = {...(fieldName,value)}
        })
        .on('end',()=>{
            console.log('Upload done!')
            req.fileAttrib=({
                files:files,
                fields:fields
            })
            next()
        })
        form.parse(req)
}

export default {
    uploadImages
}

